import React from 'react';
import Common1 from './Common1';
import Header from '../contact/header'
import Banner from '../contact/innerbanner'


const Android = () => {
    return (
        <div>
            <Header/>
            <Banner/>
            <Common1
            Services="Build Android Apps!" 
            name="Android App Development"
            intro="Mobatia offers end-to-end Android app development services and solutions. Building custom apps from the ground up, we take full advantage of all the features that go into making Android the most popular mobile platform in the world. We are always working toward setting standards in the industry through our expertise in developing exceptional applications for Jellybean and now Oreo."
            intro1="Our Android apps are developed and kept error-free in open source and subjected to upgrades as and when they come. We have successfully developed in-house and deployed several full-fledged and ready-to-use mobile applications that are uploaded in the Google Play store."
            ser1=" "
            ser=" "
            
            />
        </div>
    );
};

export default Android;
